import React from "react";
import { ReactComponent as Logo } from "../assets/Logo.svg";
import Button from "../components/Button";
export function SignUp() {
  return (
    <div>
      <Logo />
      <form>
        <input type="text" name="name" placeholder="Nombres: " />
        <input type="text" name="surname" placeholder="Apellidos: " />
        <input type="text" name="id" placeholder="Identificación: " />
        <input type="number" name="contact" placeholder="Contacto: " />
        <input type="email" name="mail" placeholder="Correo: " />
        <input type="email" name="mail-conf" placeholder="Confirmar correo " />
        <input type="password" name="password" placeholder="Contraseña: " />
        <input
          type="password"
          name="password-conf"
          placeholder="Confirmar contraseña "
        />
        <Button type="submit" value="Crea tu cuenta" />
      </form>
    </div>
  );
}
